import styled from 'styled-components'


export const Container = styled.div`
    display: flex;
    justify-content: center;
`

export const Img = styled.img`
    width: 32rem;
    margin: 1rem;
    border: 2px solid #cb9b87;

    &:hover {
        cursor: pointer
    }
`
